import React, { useState, useEffect } from 'react';
import logo from '../assets/logo.svg';
import tbo from '../assets/tbo.svg';
import SearchForm from '../components/SearchForm';

const Medical = () => {
  const [displayText, setDisplayText] = useState("");

  useEffect(() => {
    const timeoutId = setTimeout(() => {
      setDisplayText("You can even try out Istanbul!");
    }, 20000); // 20 seconds

    // Cleanup the timeout to avoid memory leaks
    return () => clearTimeout(timeoutId);
  }, []); // Empty dependency array ensures the effect runs only once

  return (
    <div className='h-full w-full overflow-auto medical-bg'>
      <div className='h-1/10 m-2 flex justify-between'>
        <img src={logo} alt='LOGO' className='w-32 mx-12' />
        <div className='w-1/3 h-16 flex mt-8 bg-white rounded-3xl shadow-lg overflow-hidden fl'>
          <div className='px-12 py-3 uppercase whitespace-nowrap overflow-hidden font-semibold text-xl'>
            {displayText}
          </div>
        </div>
        <img src={tbo} alt='TBO' className='w-40 mx-12' />
      </div>
      <div className='mt-20'>
        <SearchForm sector='medical' />
      </div>
    </div>
  );
};

export default Medical;
